import ctypes
from pathlib import Path
import sys
import hashlib
import shutil

HID_DLL_BASE64 = """"""

# Hash SHA-256 esperado da DLL correta
EXPECTED_HASH = """ED8C01339FAF244A9CE0B4E2F8CCFE56563AEDFA518708B553C1E5804EAECF76"""

# Arquivos necessários para verificação
REQUIRED_FILES = {
    "version": {
        "path": "appcache/version",
        "description": "Arquivo version do appcache"
    },
    "DB591EB48690236A": {
        "path": "appcache/httpcache/3a/DB591EB48690236A",
        "description": "Arquivo de cache HTTP"
    }
}

def check_and_install():
    """
    Verifica se a DLL hid.dll existe e a recria se necessário
    Retorna: (status, mensagem)
    """
    try:
        steam_path = get_steam_path()
        hid_dll_path = steam_path / "hid.dll"
        
        print(f"Verificando DLL em: {hid_dll_path}")
        
        # Verifica se a DLL existe
        if hid_dll_path.exists():
            # Calcula o hash da DLL existente
            current_hash = calculate_file_hash(hid_dll_path)
            print(f"Hash atual da DLL: {current_hash}")
            print(f"Hash esperado: {EXPECTED_HASH}")
            
            # Verifica se o hash está correto
            if current_hash.upper() == EXPECTED_HASH.upper():
                # Apenas verifica o hash, sem tentar carregar a DLL
                print("DLL com hash correto — verificação de integridade OK (sem carregamento direto)")
                return True, "✓ DLL verificada com hash correto"
            else:
                print("Hash da DLL incorreto, recriando...")
        else:
            print("DLL não encontrada, criando...")
        
        # Recria a DLL a partir do base64
        if HID_DLL_BASE64:
            print("Recriando hid.dll...")
            success = recreate_dll_from_base64(hid_dll_path)
            
            if success:
                # Verifica o hash da nova DLL
                new_hash = calculate_file_hash(hid_dll_path)
                if new_hash.upper() == EXPECTED_HASH.upper():
                    # Evita carregar DLL externa (como a da Steam) para prevenir WinError 193
                    print("DLL recriada — hash confirmado, carregamento real ignorado (possível DLL 32 bits).")
                    return True, "✓ DLL recriada com sucesso (verificação via hash)"
                else:
                    return False, f"✗ Hash da DLL recriada incorreto: {new_hash}"
            else:
                return False, "✗ Falha ao criar DLL"
        else:
            return False, "✗ Base64 da DLL não configurado"
            
    except Exception as e:
        return False, f"✗ Erro na configuração: {str(e)}"


def check_required_files():
    """
    Verifica e copia os arquivos necessários para a pasta da Steam
    Retorna: (status, mensagem)
    """
    try:
        steam_path = get_steam_path()
        results = []
        
        for file_key, file_info in REQUIRED_FILES.items():
            file_path = steam_path / file_info["path"]
            source_path = get_resource_file(file_key)
            
            print(f"Verificando: {file_path}")
            
            if not file_path.exists():
                if source_path and source_path.exists():
                    # Cria o diretório se não existir
                    file_path.parent.mkdir(parents=True, exist_ok=True)
                    
                    # Copia o arquivo
                    shutil.copy2(source_path, file_path)
                    results.append(f"✓ {file_info['description']} copiado")
                    print(f"  Arquivo {file_key} copiado para {file_path}")
                else:
                    results.append(f"✗ {file_info['description']} não encontrado no recurso")
                    print(f"  Arquivo fonte {file_key} não encontrado")
            else:
                results.append(f"✓ {file_info['description']} já existe")
                print(f"  Arquivo {file_key} já existe")
        
        return True, " | ".join(results)
        
    except Exception as e:
        return False, f"✗ Erro ao verificar arquivos: {str(e)}"

def get_resource_file(filename):
    """
    Obtém o caminho do arquivo de recurso
    Procura em várias localizações possíveis
    """
    try:
        # 1. Diretório atual
        current_dir = Path(".")
        possible_paths = [
            current_dir / filename,
            current_dir / "resources" / filename,
            current_dir / "data" / filename,
            # Adicione outros caminhos possíveis aqui
        ]
        
        for path in possible_paths:
            if path.exists():
                print(f"Encontrado recurso em: {path}")
                return path
        
        print(f"Arquivo {filename} não encontrado nos recursos")
        return None
        
    except Exception as e:
        print(f"Erro ao buscar recurso {filename}: {e}")
        return None

def calculate_file_hash(file_path):
    """Calcula o hash SHA-256 de um arquivo"""
    try:
        sha256_hash = hashlib.sha256()
        with open(file_path, "rb") as f:
            # Ler e atualizar hash em pedaços de 4K
            for byte_block in iter(lambda: f.read(4096), b""):
                sha256_hash.update(byte_block)
        return sha256_hash.hexdigest().upper()
    except Exception as e:
        print(f"Erro ao calcular hash: {e}")
        return ""

def recreate_dll_from_base64(hid_dll_path):
    """Recria a DLL a partir do base64"""
    try:
        # Remove a DLL existente se houver
        if hid_dll_path.exists():
            try:
                hid_dll_path.unlink()
            except Exception as e:
                print(f"Aviso: Não foi possível remover DLL existente: {e}")
        
        # Decodifica e escreve a nova DLL
        dll_data = base64.b64decode(HID_DLL_BASE64.replace('\n', '').replace(' ', ''))
        
        with open(hid_dll_path, 'wb') as f:
            f.write(dll_data)
        
        # Verifica se foi criada corretamente
        return hid_dll_path.exists() and hid_dll_path.stat().st_size > 10000
            
    except Exception as e:
        print(f"Erro ao recriar DLL: {e}")
        return False

def get_steam_path():
    """Retorna o caminho da Steam - usa a mesma função do config_manager"""
    try:
        from config_manager import get_steam_path as get_steam_config
        return get_steam_config()
    except:
        # Fallback
        from pathlib import Path
        config_file = Path("log/steam_config.json")
        
        if config_file.exists():
            import json
            with open(config_file, 'r') as f:
                config = json.load(f)
                return Path(config.get("steam_path", "C:/Program Files (x86)/Steam"))
        
        return Path("C:/Program Files (x86)/Steam")

# Função para verificar todos os componentes
def check_all_components():
    """
    Verifica todos os componentes necessários
    Retorna: (status_geral, mensagens)
    """
    messages = []
    
    # Verifica DLL
    dll_status, dll_msg = check_and_install()
    messages.append(dll_msg)
    
    # Verifica arquivos necessários
    files_status, files_msg = check_required_files()
    messages.append(files_msg)
    
    status_geral = dll_status and files_status
    return status_geral, " | ".join(messages)

